SELECT replace((prod_creation_date at time zone 'UTC')::varchar, ' ', 'T')||'Z' as utc_timestamp 
FROM #{db_schema}.#{db_table_rad} pd
WHERE pd.prod_filename = '${prod_filename}';

SELECT 1 as outmsg 
FROM #{db_schema}.#{db_table_rad}
WHERE
	prod_code = '${prod_code}'
	AND prod_creation_date = to_timestamp(${prod_creation_date}/1000)
LIMIT 1;
